import React, { Component } from "react"

class Listmembre extends Component{
    state = {
        datas: this.props.datas
    }
    render(){
        return(
            <ul className="list-group">{this.state.datas.map(arg => console.log(arg.nom))}</ul> 
        )
    }
}
export default Listmembre
